  useEffect ( () => {
    axios.get("http://localhost:8081/user")
    .then( (res) => {
      console.log(res.data.user);
      setUserData(res.data.user);

    })
    .catch((error) => {
      console.error('Error fetching user data:', error);
    });
  }, [] )

  return (
    <div>
    <h1>{userData}</h1>

    </div>
  )
}

export default Home
